css:
.atomts-rename-view .options-label {
  color: #777;
  position: relative;
}
.atomts-rename-view .options-label .options {
  color: #333;
}
.atomts-rename-view .subtle-info-message {
  padding-left: 5px;
  color: #777;
}
.atomts-rename-view .find-container,
.atomts-rename-view .replace-container,
.atomts-rename-view .paths-container {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.atomts-rename-view .find-container .btn-group,
.atomts-rename-view .replace-container .btn-group,
.atomts-rename-view .paths-container .btn-group {
  margin-left: 10px;
}
.atomts-rename-view .find-container .editor-container,
.atomts-rename-view .replace-container .editor-container,
.atomts-rename-view .paths-container .editor-container {
  position: relative;
  -webkit-flex: 1;
}
